import './App.css';
import React from 'react';

class App extends React.Component {

  onClickGoogle = async term => {
    console.log(term)
    window.gapi?.auth2.init({
        client_id: '571417961310-svapabdv4mq5hulnv4lojgcofhd07bpv.apps.googleusercontent.com',
        scope: 'email profile openid',
        response_type: 'permission',
        fetch_basic_profile:'false'
      }, (response)=> {
          console.log(response)
        if (response.error) {
          return;
        }
        // The user authorized the applicfunctionation for the scopes requested.
        var accessToken = response.access_token;
        var idToken = response.id_token;
        console.log(accessToken,idToken)
      });
}
 onSignIn=()=> {
   const googleUser = window.gapi.auth2.getAuthInstance().currentUser.get();
    var profile = googleUser?.getBasicProfile();
   console.log(profile)    
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <React.Fragment>
              <div className="g-signin2" data-onsuccess="onSignIn" onClick={ this.onSignIn}></div>
            </React.Fragment>

        </header>
      </div>
    );
  }
}

export default App;
